  const out = [];
  for (const i of items) {
    if (out.indexOf(i) === -1) {
      out.push(i);
    }
  }
  return out;
}
```

**Complexity:** O(n²) — `indexOf` is O(n) inside an O(n) loop.

## Refactored Code (O(n))
```javascript
function dedupe(items) {
  const seen = new Set();
  const out = [];
  for (const i of items) {
    if (!seen.has(i)) {
      seen.add(i);
      out.push(i);
    }
  }
  return out;
}
```

**Complexity:** O(n) — `Set.has()` and `Set.add()` are O(1) average case.

