/*
### Complexity Analysis

**Before:** `O(n^2)` (Quadratic)
The original function iterates through each `item` in the input array (n items). Inside the loop, it calls `out.indexOf(i)`. In the worst-case scenario (an array with no duplicates), `indexOf` itself must iterate through the `out` array to check for the item's existence. As `out` grows, the `indexOf` call gets progressively slower, leading to a nested loop-like behavior and quadratic time complexity.

**After:** `O(n)` (Linear)
The refactored function leverages the JavaScript `Set` object.
1. `new Set(items)`: Creates a new `Set` from the input array. This process involves iterating through the `items` array once. Since `Set`s only store unique values, duplicates are automatically discarded. Lookups and insertions in a `Set` are, on average, O(1) operations.
2. `[...new Set(items)]`: The spread syntax then iterates through the unique values in the `Set` once to create a new array.
Because the array is iterated only once to build the `Set`, and the `Set` is iterated only once to build the final array, the overall time complexity is linear. `Set` objects also preserve insertion order, so the "first-seen" order is maintained.
*/

// Original (for reference)
function dedupe_original(items) {
  const out = [];
  for (const i of items) {
    if (out.indexOf(i) === -1) {
      out.push(i);
    }
  }
  return out;
}

// Refactored
function dedupe(items) {
  return [...new Set(items)];
}


